    [],nt"num_tags": 8,nt"name": "integrating-management-objectives-and-grazing-strategies-on-semi-arid-rangelands",nt"isopen":
    false,nt"url": null,nt"notes": "Rangelands account for almost half of Nebraska's
    24 million acres. Much of these expansive natural resource areas are in the semi-arid
    climatic region of Nebraska where grazing management decisions have a profound effect
    on ranch survival. This circular covers management practices that optimize the sustainability
    of rangeland and includes a decision-support tool for selecting grazing systems
    best suited to management objectives. Includes a chart of how differences in reproduction
    schedules, initial livestock weigh, and/or average daily gain affect animal unit
    equivalents in cow-calf and yearling enterprises.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
